import React from "react";

import {Routes, Route, NavLink, Navigate} from "react-router-dom";
import pages from './components/pages/index';

function App() {

  return (
    <div className="App">
      <Routes>
        <Route path="/" exact element={pages.intro()} />
        <Route path="/contact" exact element={pages.contact()} />
        <Route path="/financial_info" exact element={pages.financialInfo()} />
        <Route path="/financial_info" exact element={pages.businessInfo()} />
        <Route path="/financial_info" exact element={pages.policies()} />
        <Route path="/financial_info" exact element={pages.industry()} />
        <Route path="*" element={pages.intro()} />
      </Routes>
    </div>
  );
}

export default App;
